script: |
  super -f text -I q6435.spq | sort > q6435.out

inputs:
  - name: q6435.spq
    data: |
      SELECT col1 / + col1 + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT ( - 30 * col0 ) > 84 * col2 + - 50 * ( ( col1 ) );
  - name: tab1

outputs:
  - name: q6435.out
    data: |
      52
      86
      92
